import dailyCases from "../../utility/dailyCases.png";
import totalCases from "../../utility/totalCases.png";
import one from "../../utility/1.webp";
import './Images.css'

function Images() {
    return (<>
        <img  src={dailyCases} alt={"Carlie Anglemire"}/>
        <img className="" src={totalCases} alt={"Carlie Anglemire"}/>
    </>
    )
}
export default Images;
